import React ,{ useEffect,useState } from 'react'

import {useHistory} from 'react-router-dom'

const Post = () => {


  const history= useHistory();

  const [getUser, setInfil]= useState();



  const profileDataGet=  async ()=>{
      try{
          const res =  await fetch('/profile',{
        method:"GET",

        credentials:"include",
         withCredentials:true,

        headers:{
           Accept:"application/json",
            "Content-Type": "apllication/json"
         }





  });

  const data= await res.json();
  console.log(data);
  if(data.status === 422){

    setInfil(data);
      
  }

      }catch(err){
          console.log(err);
       history.push('/login')

      }

    

     



  }

  useEffect(()=>{
    profileDataGet();


}, []);


    return (
    <>
      <div className="signup">
        
          <div className="container emp-profile">
            
             <div   className="col-lg-10 offset-lg-1">
             <form id="product_details_form">
                   

                  <div  className= "contact_form_container py-5"> 
                       <div className="product">
                            < h1 >Product Details</h1>
                        </div>
                   
                      <form  method='GET'>

                      <div className="contact_form_name ">

                          <div  className="product_details_item">
                            
                            
                           
                         <input type="text" id = "name" className="contact_form_name input_field" 

                            value={getUser.name}

                         placeholder="Your Name"  required="true"/>
                          </div>

                          <div  className="product_details_item">
                            
                            
                           
                         <input type="text" id = "userId" className="contact_form_name input_field" 
                            
                        value={getUser.userId}

                         placeholder="Your userId"  required="true"/>
                          </div>
                         
                          <div  className="product_details_item">
                            
                            
                           
                            <input type="text" id = "role" className="contact_form_name input_field" 
                               
                            value={getUser.role}
   
                            placeholder="Your role"  required="true"/>
                             </div>
                             <div  className="product_details_item">
                            
                            
                           
                            <input type="text" id = "org" className="contact_form_name input_field" 
                               
                            value={getUser.org}
   
                            placeholder="Your organization"  required="true"/>
                             </div>
                            
                             <div  className="product_details_item" >
                          
                         
                          <input type="text" id = "productname" className="contact_form_name input_field" 
                             
                          
 
                          placeholder=" Your Product Name "  required="true"/>
                          </div>
 

                         <div  className="product_details_item" >
                          
                         
                         <input type="text" id = "quantity" className="contact_form_name input_field" 
                            
                         

                         placeholder=" Quantity"  required="true"/>
                         </div>


                         <div className="product_details_item" >                            
                            
                           
                            <input type="text" id = "unit" className="contact_form_name input_field" 
                            placeholder="unit"  required="true"/>
                             </div>
                            

                       </div>

                      </form>

                  </div> 
                  <div className="contact_form_button align-center" >
               <button  type="submit"  className="button contact_submit_button" > Upload</button>

           </div>



                </form>
             </div>
               


           </div>

           
          </div>
           
        </>
    )
}

export default Post
